import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import $ from 'jquery';
// import 'magnific-popup';

// import videobg from '../../../assets/img/text-block/04.jpg';
// import aboutimg from '../../../assets/img/text-block/05.jpg';
import myImage from '../../../assets/img/team/urban-fox-logo-transparent-bg.png'; // replace with the actual path to your image

const featurespost = [
    { icon: 'flaticon-coffee', title: 'breakfast', animation: '.3s' },
    { icon: 'flaticon-air-freight', title: 'Airport Pickup', animation: '.4s' },
    { icon: 'flaticon-marker', title: 'city guide', animation: '.5s' },
    { icon: 'flaticon-barbecue', title: 'bbq party', animation: '.6s' },
    { icon: 'flaticon-hotel', title: 'luxury room', animation: '.7s' },
];
class About extends Component {
    componentDidMount() {
        // function popup() {
        //     $('.popup-video').magnificPopup({
        //         type: 'iframe',
        //     });
        // }
        // popup();
    }
    render() {
        return (
            <section className="about-section pt-115 pb-115">
                <div className="container">
                    <div className="section-title about-title text-center">
                        <span className="title-tag">What We're <span>About</span></span>
                        <h2>Welcome to Urban Fox Rentals</h2>
                        <br />
                        <br />
                        <h3>At Urban Fox Rentals, we believe home is more than just a place to stay—it’s a space to thrive.
                        <br />
                        <br />

                        Nestled in Park Slope, Brooklyn, our thoughtfully designed apartments provide a stress-free living experience for professionals, students, and anyone navigating life’s transitions. Whether you’re pursuing your career, furthering your education, or simply seeking a peaceful retreat, our spaces offer comfort, convenience, and community—all without the hassle of traditional moving.
                        <br />
                        <br />


                        Urban Fox Rentals was born from my own journey—a leap from marketing into healthcare, where I saw firsthand the importance of a nurturing environment. Inspired by that, I created homes that prioritize your well-being, helping you focus on what matters most.
                        <br />
                        <br />
                        Here, you’ll find more than a place to rest. You’ll find a space to grow, recharge, and call home.
                        <br />
                        <br />
                        <img src={myImage} alt="Urban Fox Logo "/> {/* Add this line */}
                        </h3>


                    </div>
                </div>
            </section>
        );
    }
}

export default About;
